const photos=[
    {
        url:"/images/slider1.jpg"
    },
    {
        url:"/images/slider2.jpg"

    },
    // {
    //     url:"/images/slider3.jpg"
    // }
]



class About extends Component{
    render(){
        const settings={
            dots:true,
            speed:100,
            autoplaySpeed: 2500,
            infinite:true,
            slidesToShow:1,
            slidesToScroll:1,
            arrows:true, 
            autoplay: true,
            className:"slides"
        };
        return(
            <div>
                <Slider{...settings} >
                    {photos.map((photo)=>{
                        return(<div>
                            <img width="100%" height="600" src={photo.url} alt=""/>
                        </div>
                        )
                    })}

                </Slider>
                <div className="container">
                    <br/>
                    <h5 className= "center blue-text text-darken-4 ">A ONE-STOP SHOP FOR AN ULTIMATE LUXURY VEHICLE IN OTTAWA</h5>
                    <div class="divider"></div>
                    <div class="section">
                        <h5>Section 1</h5>
                        <p>Stuff</p>
                    </div>
                    <div class="divider"></div>
                     <div class="section">
                        <h5>Section 2</h5>
                        <p>Stuff</p>
                    </div>
                    <div class="divider"></div>
                    <div class="section">
                        <h5>Section 3</h5>
                        <p>Stuff</p>
  </div>




                </div>

            </div>

        )





    }
}

export default About;
